import React from 'react';
import { Box, Grid, Typography } from '@material-ui/core';

const Footer = () => {
    return (
        <>
            <footer>
                <Box py={5}>
                    <Grid container>
                        <Grid item lg={6} md={6} sm={6} xs={12}>

                        </Grid>
                        <Grid item lg={6} md={6} sm={6} xs={12}></Grid>
                    </Grid>
                </Box>
            </footer>
        </>
    )
}

export default Footer
